define('text!../widgets/ftv.widgetSocial/js/templates/popin.html',[],function () { return '<div id="popinReseauxSociaux" style="display:none;">\n\t<div class="mask"></div>\n\t<div id="popin-wrapper">\n\t\t<div class="top"></div>\n\t\t<div class="mid">\n\t\t\t<a href="#" class="close" title="fermer">&nbsp;</a>\n\t\t\t<div id="popin-content">\n\t\t\t\t<div class="content">\n\t\t\t\t\t<div class="post cf">\n\t\t\t\t\t\t<%= post %>\n\t\t\t\t\t</div>\n\t\t\t\t</div>\n\t\t\t\t<% if(type==\'twitter\') { %>\n\t\t\t\t<div class="footer twitter">\n\t\t\t\t\t<a class="forward" title="Retweeter" href="https://twitter.com/intent/retweet?tweet_id=<%= post_id %>">Retweeter</a>\n\t\t\t\t\t<a class="answer" title="Rpondre" href="https://twitter.com/intent/tweet?in_reply_to=<%= post_id %>">Rpondre</a>\n\t\t\t\t\t<a class="favorite" title="Favoris" href="https://twitter.com/intent/favorite?tweet_id=<%= post_id %>">Favoris</a>\n\t\t\t\t\t<a class="website" title="Voir sur Twitter" href="https://twitter.com/<%= name %>" target="_blank">Voir sur Twitter</a>\n\t\t\t\t\t<div class="clearer"></div>\n\t\t\t\t</div>\n\t\t\t\t<% }else{ %>\n\t\t\t\t<div class="footer facebook">\n\t\t\t\t\t<!--\n\t\t\t\t\t<a onclick="fbLike(); return false;" title="J\\\'aime" class="like" target="_self">Like</a>\n\t\t\t\t\t<span class="sep"></span>\n\t\t\t\t\t<a onclick="fbComment(); return false;" title="Commenter" class="comment" target="_self">Commenter</a>\n\t\t\t\t\t<span class="sep"></span>\n\t\t\t\t\t-->\n\t\t\t\t\t<a onclick="fbShare(); return false;" title="Partager" class="share" target="_self">Partager</a>\n\t\t\t\t\t<div class="clearer"></div>\n\t\t\t\t</div>\n\t\t\t\t<% } %>\n\t\t\t\t<div class="clearer"></div>\n\t\t\t</div>\n\t\t</div>\n\t\t<div class="bot"></div>\n\t</div>\n</div>';});

